import React from 'react';
import { Col } from 'reactstrap';
import BuffetMenuItem from '../Components/BuffetMenu/BuffetMenuItem';

class BuffetMenu extends React.Component{
    render(){
        return (
            <Col sm="10">
                <BuffetMenuItem/>
            </Col>
        );
    }
};

export default BuffetMenu;
